💟

I wanted to talk about nutrition for a second. And post baby weight loss. When I had Lily, losing baby weight wasn’t an issue. I didn’t have to try and the weight just came off. But, after I had Lukey (even though I gained significantly less) the last 25 pounds wouldn’t come off by themselves. For almost an entire year, I followed an eating program that I still love and believe in wholeheartedly to this day. It is based on whole foods and balanced macronutrients in the proper portions. It’s realistic and sustainable. It also provides a great way to show someone what proper fueling looks like for their personal goals. After the year, and reaching my goals in terms of weight loss, I still use the principles of this program to guide how I eat daily. 

💟

A few months ago, my goals changed. At first, my goal was post baby weight loss. Now, my goals have changed into fueling my body for endurance. Since we’re being honest, in the last 3 months, I have not been 100% with my nutrition like I was for the 9 months before that. But, after following this program, I have a very solid understanding of how much protein, carbs, and fats I need in a day to sustain my performance. I am also a lot more educated when it comes to food choices no matter if I’m at a restaurant, grocery store, or a friend or family members’ house. It has alleviated a lot of anxiety I’ve had about food in the past. It has also allowed me to achieve goals for running that I never thought I’d ever be able to do. Run 11 miles?! What?! That still sounds insane to me. 

💟

I say all that to say - this plan really changed my life at a time that I really needed it. And for that I am very thankful. 

💟
